import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';

const Dashboard = ({ user, setView }) => {
  const [requests, setRequests] = useState([]);
  const [loading, setLoading] = useState(true);
  const [form, setForm] = useState({
    documentType: '',
    fullName: '',
    purpose: '',
    deliveryMethod: '',
    address: ''
  });
  const [message, setMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [submitting, setSubmitting] = useState(false);

  const fetchRequests = useCallback(async () => {
    setLoading(true);
    try {
      const res = await axios.get(`http://localhost:3001/my-requests?userId=user::${user.email}`);
      console.log('Fetched requests:', res.data);
      setRequests(res.data);
    } catch (error) {
      console.error('Error fetching requests:', error);
      setMessage('Failed to load requests. Please check your connection.');
      setIsError(true);
    } finally {
      setLoading(false);
    }
  }, [user.email]);

  useEffect(() => {
    console.log('User in Dashboard:', user);
    fetchRequests();
  }, [fetchRequests, user]);

  const submitRequest = async (e) => {
    e.preventDefault();
    if (!form.documentType || !form.fullName || !form.purpose || !form.deliveryMethod || !form.address) {
      setMessage('Please fill in all fields');
      setIsError(true);
      return;
    }
    setSubmitting(true);
    try {
      await axios.post('http://localhost:3001/submit-request', { ...form, userId: `user::${user.email}` });
      setForm({ documentType: '', fullName: '', purpose: '', deliveryMethod: '', address: '' });
      setMessage('Request submitted successfully!');
      setIsError(false);
      fetchRequests();  // Refresh list
    } catch (error) {
      setMessage('Error submitting request');
      setIsError(true);
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div>
      <h1>üìä Dashboard</h1>
      <p>Welcome, {user.fullName}! üëã</p>
      <button className="admin-btn" onClick={() => setView('admin')}>Admin View</button>
      
      <h3>üìù Submit New Request</h3>
      <form onSubmit={submitRequest}>
        <div className="form-group">
          <select
            value={form.documentType}
            onChange={e => setForm({ ...form, documentType: e.target.value })}
            required
            aria-label="Document Type"
          >
            <option value="">Select Document Type</option>
            <option>Birth Certificate</option>
            <option>Marriage Certificate</option>
            <option>Death Certificate</option>
            <option>CENOMAR</option>
            <option>CENODeath</option>
            <option>Certificate of Indigency</option>
            <option>Certificate of Residency</option>
            <option>Barangay Clearance</option>
            <option>Community Tax Certificate</option>
            <option>Police Clearance</option>
            <option>NBI Clearance</option>
          </select>
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="üë§ Full Name"
            value={form.fullName}
            onChange={e => setForm({ ...form, fullName: e.target.value })}
            required
            aria-label="Full Name"
          />
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="üéØ Purpose"
            value={form.purpose}
            onChange={e => setForm({ ...form, purpose: e.target.value })}
            required
            aria-label="Purpose"
          />
        </div>
        <div className="form-group">
          <select
            value={form.deliveryMethod}
            onChange={e => setForm({ ...form, deliveryMethod: e.target.value })}
            required
            aria-label="Delivery Method"
          >
            <option value="">Select Delivery Method</option>
            <option>Pickup</option>
            <option>Mail</option>
          </select>
        </div>
        <div className="form-group">
          <input
            type="text"
            placeholder="üìç Address"
            value={form.address}
            onChange={e => setForm({ ...form, address: e.target.value })}
            required
            aria-label="Address"
          />
        </div>
        <button type="submit" disabled={submitting}>
          {submitting && <span className="spinner"></span>}
          Submit Request
        </button>
      </form>
      
      {message && <p className={isError ? 'error' : 'success'}>{message}</p>}
      
      <h3>üìã My Requests</h3>
      {loading ? <p>Loading requests...</p> : requests.length === 0 ? <p>No requests found. Submit one above!</p> : (
        <ul>
          {requests.map(r => (
            <li key={r.id}>
              <span>{r.documentType} - <span className={`status ${r.status ? r.status.toLowerCase() : 'unknown'}`}>{r.status || 'Pending'}</span></span>
              <span>üìÖ {r.submittedAt ? new Date(r.submittedAt).toLocaleDateString() : 'N/A'}</span>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Dashboard;
